description:
You can play for an evening relaxation or test your skills with both single and online challenges. Through breathtaking atmosphere you try and catch falling, colored elements with intuitive one touch controls where you drag and re-order your base that results in a meditative but also challenging world.

Choose your elements, choose your mode best for your mood. Decide whether you want to relax or fast and difficult challenge. Make your way through a memorable journey Start to Twist and have fun!

GREAT MUSIC by Composer Manu Shrine;
MEMORABLE JOURNEY through variety of places;
BREATHTAKING ATMOSPHERE to both relax and challenge yourself;
CHOOSE YOUR ELEMENTS between SUPRISING PACKS featuring Darklings, Rop and Jelly Lab;
JOIN Online daily Challenges and earn special rewards;

LET'S TWIST!..

Required Android o/s: 4.0.3
